sys_variable_value.value:
(function execute(inputs, outputs) {

    if (inputs.worker_id) {
        const workerUtil = new x_376096_mpl.MPLWorkerUtil(inputs.worker_id);
        if (inputs.percent || inputs.percent == 0) {
            workerUtil._trackerUpdatePercentComplete(inputs.percent);
        }

        if (inputs.message) {
            workerUtil._trackerUpdateMessage(inputs.message);
        }
    }

})(inputs, outputs);

